import React from 'react';

const TodoItem = ({id, title, description, onChange}) => {
return (<div className='card'>
<li key={id}>
<input value={title} onChange={(e,id)=> {onChange(e,id)}}/>
<input value={description} onUpdate={(e,id)=> {onUpdate(e,id)}}/>
<input type="checkbox"/>
<button> Trash </button>
{id}
</li>
</div>)
}

export default TodoItem;
